import React from 'react'
import Movie from './Movie'
export default function Movies(props) {
    const { movies } = props
    return (
        <div className='movies'>
            <div className="container">
                <div className="row">
                    {
                        movies.map(movie => (
                            <Movie key={movie.imdbID} {...movie} />
                        ))
                    }
                </div>
            </div>
        </div>
    )
}
